hold off;
title(['Segmentazione Finale Fegato (Slice ', num2str(slice_to_show), ')']);
pause(0.01)

% Il volume 'refinedLiverMask' contiene la tua segmentazione finale del fegato.
end %[output:group:396c6bb4]

